import React, { useState, useEffect } from "react";

const Map = ({place, setPlace})=>{
	const [address, setAddress] = useState(
		`https://www.openstreetmap.org/export/embed.html?bbox=-180.35156250000003%2C-52.908902047770255%2C211.99218750000003%2C82.02137801950887&amp;layer=cyclemap`
	);
	console.log({ place });
	

	return (
		<>
			<iframe
				title='Map'
				width='100%'
				height='106%'
				scrolling='no'
				style={{ marginTop: "-10vh" }}
				src={address}></iframe>
		</>
	);
};

export default Map;
